// Set report suite based on environment
appCookie = _satellite.getVar('AppMode') || '';

window.tracking = {};
window.tracking.isIphoneApp = /iphone/i.test(appCookie);
window.tracking.isAndroidApp = /android/i.test(appCookie);
window.tracking.isDevEnvironment = !/(bestbuy\.ca)/i.test(location.hostname);

if(window.tracking.isDevEnvironment || localStorage.getItem('sdsat_stagingLibrary') == 'true') {
  if (window.tracking.isIphoneApp) {
    var appVersion = parseFloat(_satellite.getVar('AppVersion') || '').toFixed(2);
    if (appVersion >= 6.0) {
      s_account = 'bbycanadanewiphonedev';
    } else {
	    s_account = 'bbycanadaiphonedev';
    }
	} else if(window.tracking.isAndroidApp) {
	  s_account = 'bbycanadaandroiddev';
  } else {
		s_account = 'bbycanewdev';
  }
} else {
  if (window.tracking.isIphoneApp) {
    var appVersion = parseFloat(_satellite.getVar('AppVersion') || '').toFixed(2);
    if (appVersion >= 6.0) {
      s_account = 'bbynewcanadaiphoneprod';
    } else {
	    s_account = 'bbycanadaiphoneprod';
    }
  } else if(window.tracking.isAndroidApp) {
    s_account = 'bbycanadaandroidprod';
  } else {
		s_account = 'bbycaproduction';
  }
}

var s = s_gi(s_account);

s.usePlugins = true;

s.doPlugins = function(s) {
  var theDate = new Date();
  var currentYear = (theDate.getFullYear());

  s.prop10 = s.getPreviousValue(s.prop1,'gpv_pt');
  s.prop12 = s.getTimeParting('h','-8', currentYear); //set hour of day
  s.prop13 = s.getTimeParting('d','-8', currentYear); //set Day of week
  s.prop23 = s_getLoadTime();
  s.prop45 = "D=v76"; //prop45: prev page name
  s.prop46 = s.getPercentPageViewed(); //prop46: max % viewed of prev page
  if(!s.prop45||s.prop45=='no value')s.prop46=''; //clear max % viewed if no prev page view
  s.prop76 = "D=v76";

  s.eVar13 = s.getDaysSinceLastVisit('s_lv');
  s.eVar42 = s.getNewRepeat(30,'s_getNewRepeat');
  s.eVar43 = s.getVisitNum();
  s.eVar46 = s.crossVisitParticipation(s.campaign,'s_ev46','30','5','>','',0);
  s.eVar49 = s.prop23; //see s.prop23 above
  s.eVar76 = s.getPreviousValue(s.pageName,'gpv_pv');
  s.eVar77 = s.getVisitStart('s_visit');
  if (s.eVar77==1) { new dtm_counter('path').reset(); }
  s.pvel = 'event67,event68,event69';

  s.getPageVisibility();
}

